import React from 'react';
import ReactDom from 'react-dom';
import "./index.css";

const fname = "SANEHA";
const lname = "GARG";
const currDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();
const img1 = "https://picsum.photos/250/300";
const img2 = "https://picsum.photos/300/300";
const links = "https://www.google.com";
ReactDom.render(
<>
<h1 class="heading">Pick your Netflix Series</h1>
<p>Here is the list</p>
<ol>
  <li>Friends</li>
  <li>Manifest</li>
  <li>Class</li>
  <li>Sex Education</li>
  <li>Moneyheist</li>
  <li>Stranger Things</li>
  <li>Wednesday</li>
  <li>Squid Game</li>
</ol>
<h3>{`- ${fname} ${lname}`}</h3>
<p>Date: {currDate}</p>
<p>Time: {currTime}</p>
<h4 contentEditable = "true"> Random pics: </h4>
<img src = "https://picsum.photos/200/300" alt="randomImages"/>
<img src = {img1} alt="randomImages"/>
<a href={links} target="_google"> 
<img src = {img2} alt="randomImages"/>
</a>
</>,
document.getElementById('root') );
